import {Component} from 'react';
import Counter from './Counter.js';
import Delete from './Delete.js';

class Item extends Component{

    render(){
        return (
            <table>
                <tbody>
                    <tr>
                        <td colSpan="2"><Counter /></td>
                        <td colSpan="2"><Delete /></td>
                    </tr>
                </tbody>
            </table>
        );
    }
}

export default Item;
